import React from "react";
import menuDate from '../src/redux/state';
import classes from "./components/Navigation/Navigation.module.css";



let menuData = menuDate.navigation.menuData;
 export let dropdownLi = menuDate.map(e=> (
    <li className={classes.li_dropdoun}>
        <a href={e.url}>{e.label}</a>
    </li>
));
